
function setupMockStorage() {
    app.service('StorageService', function () {

        this.findAllRecipes = function () {
            return this.recipes;
        };
        this.findRecipe = function (recipeId) {
            return this.recipes[recipeId];
        };
        this.addRecipe = function (recipe, recipes) {
            var numberOfRecipes = Object.keys(recipes).length;
            recipe.$id = '' + (numberOfRecipes + 1);
            recipes[recipe.$id] = recipe;
        };
        this.updateRecipe = function (/*recipe*/) {
            return true;
        };

        this.recipes = {};
        this.recipes['1'] = { $id: '1', name: 'Lasagne', tags: 'pasta', image: 'data:image/jpeg;base64,'};
        this.recipes['2'] = { $id: '2', name: 'Bacalao', tags: 'fisk tomat', image: 'data:image/jpeg;base64,'};
        this.recipes['3'] = { $id: '3', name: 'Taco', tags: 'meksikansk', image: 'data:image/jpeg;base64,'};
    });
}
